text:
Alguns pontos positivos que vi no Palmeiras nesse jogo:
- Piquerez é melhor que Matías Viña (eu tinha essa dúvida);
- De zagueiros, estamos MUITO BEM (nenhum time da América tem uma zaga melhor que a nossa, titulares + reservas);
- O Rony, que o Abel não tira por nada, joga melhor de ponta;
- O Lomba é confiável;
- Os moleques da base estão entrando bem.

Pontos negativos:
- Scarpa só joga bem coletivamente; quando ele quer resolver sozinho, atrapalha o time;
- Navaro não é 9;
- O Zé Rafael está caindo de rendimento (será que é a falta do Danilo?);
- Sem danilo e Veiga, o time cai muito de rendimento (Contrate o De la Cruz, Leila!!!).

1°- Palmeiras tava jogando dentro de casa, portanto tinha obrigação de ter mais volume de jogo e chances criadas;
2°- Atletico também estava desfalcado ( Arana, Keno, Vargas e Zaracho, fora que vendeu o Savarino a menos de 1 mês);
Certeza que se fosse o seu time no lugar do Galo, tomava goleada pra esse time torto do Palmeiras.

 @miguelirineu2997  sabe nada do que fala 
Da uma estudada no projeto do atletico.

E tá marrado e repreendido em nome de Jesus isso que falou
